@DXdelivery Hi, thanks for the reply!

I could do that.  And am happy to do so, if you insist?  But if it'll just get the driver into trouble then I don't really see any point.  Just a suggestion that perhaps you encourage all your drivers to be a bit more... helpful.

Have a lovely evening.

@JoeBangles11 Hang in there mate, if that's what you want!

I'm on 363 days.  I'll drink if I want a drink.  I'll not drink if I don't want a drink.

PS. What's your favourite cheese (again)?

@WHearnshaw Me: Hi colleague who has the ability to email all members of the workforce.  Please send this.  Thanks very much.

*Colleague sends + Sir's and et al.*

Me: https://t.co/kDRVVnZAiH

@WHearnshaw Or my current favourite:

Hi everybody,

............

@warriorscomeout @bermicourt This!‚òùÔ∏è

And I don't pretend to be able to understand cancer.  Or openly liken it to something else within my frame of reference.

I just STFU and try to learn from cancer sufferers' stories.

@warriorscomeout @bermicourt I agree with you.

TBF my experience hasn't been so much "get a grip" (although I know a few have thought it).  This was more to help people see that the thing they're commenting on is visceral, moreso than perhaps the inexperienced can understand (good for them)!

About empathy.

@TheBlackLancer Thanks TBL.

Removing stigma (in the military) is sort of happening, IMO.  But too slowly, again IMO.  And *some* of the in-vogue stuff which has been professed is unhelpful (and potentially harmful) bollocks.

But some is frustrating enough.  Hence offering my perspective above.

@UnimportantO @wavellroom I meant the scholarship, which I don't think is ending.  But I might be wrong.

Regardless, I find it bit odd that sufficient army officer potential can be identified in a 15 year old by conducting a few days testing...

Views own.

@B4ck1n @kingsbury_ollie @Mark1_1984 @bermicourt @icsc_l @JOTAC_Army @ComdCTG @Field_Trg_Unit @MattBak63401251 @SRDMaguire @well_done_you Agree, to an extent.  These are senior captains though...

IMO we've encouraged process addiction, and an aversion to real thinking.  I'm a big fan of a broader intellectual use of "so what" during planning.

We're always reminded it's the planning, not the plan, which matters...

@CovertCopper @GunnyHighway6 @themetskipper Not you.  But you said yourself you went to one of the smaller independent schools.  And, respectfully, the dataset is larger than you. 

Look at the list of schools in this:

https://t.co/8nTEo75dv7

@B4ck1n @kingsbury_ollie @Mark1_1984 @bermicourt @icsc_l @JOTAC_Army @ComdCTG @Field_Trg_Unit @MattBak63401251 @SRDMaguire That's cool.

I'd also extend that to the context.

I haven't done much traditional CE, but I taught Q1 (gen) to my CWC syndicate a few years ago and was surprised how many were initially reticent to discard products irrelevant to the necessary analysis.

@well_done_you thoughts?

