full_text:
@SO2portaloos @G2_Lou @CombatStress Thank you.  That is very kind.  Likewise.

I DM chat with a few of the punters on here, and meeting 1 for coffee as soon as Covid allows.

I'm good, gen.  DCMH treatment taught me coping mechanisms which work.  Own house and a new career is another really good coping mechanism.‚òÆÔ∏è

@IdleMrBridle @bermicourt @SEAC_Defence @policecommander talks about how lucky he was to be able to afford continued private counselling after his work / NHS sessions ran out.

My DCMH experience (weekly for 8 months) was superb.  But how would you get that as a reservist?

I'm now just making the same point again TBF.

@PCJimmyConway @SgtJJSharps @GorillaoJustice @gmhales https://t.co/uqhTTMe2fX

Hi Jimmy.  There was an interesting debate about this earlier.  Worth a read, unless those are the points you already referred to.

I'm absolutely not saying that lower paid cops are less trustworthy.  However vulnerability = risk = manage risk = protect.

@GorillaoJustice @SgtJJSharps @gmhales TBF to @gmhales all I saw was 'integrity risk'.  And I think that the concept of risk is fairly nuanced.

But thank you.  An important discussion.  Hopefully one that relevant HR / security depts have!

(And I sense that both of our premises on this are actually very similar).

@MartynWest12 @SRDMaguire @davidgraeber Mate, I was hoping you'd get involved!

Not specifically yours... ;-)  But I often wonder what tangible direct value I've added in any of my roles.  And whether striking them off the ORBAT would make any difference.

Gen. not trying to be nihilist :-)  But an interesting debate?

@BernardoCelcius @SRDMaguire @davidgraeber Understandable.

Another side to that is frustration, when you lose your MI pers to their unit for (e.g.) unit exercises.

I suppose that 'command states' would be a valid counterargument against mine above.  But I've never understood them!

@BernardoCelcius @SRDMaguire @davidgraeber There is that requirement.  But does there have to be?  You would have more available people if there were fewer RD roles to be filled.

What training &amp; development from R/BHQs outweighs frictions?  

I'm not being a dick.  But these are often-quoted, unchallenged(?) assumptions.

@OC12AECGp Thanks!

I'm currently studying the St Andrew's Advanced Cert. Terrorism Studies.  Does this mean that I can buy ¬£175 (plus personal contribution) worth of books about terrorism?

Sorry for loads of Qs.  Just seems far too good to be true.

@SeanAllmark1 Hi mate.  Same as Will, always happy to listen.

Just a thought, and please tell me if I'm wrong (I hope so), but can tweets like this about the legal stuff be used against you?

Take care.

@CulturalRecall What actually is ADHD (as opposed to the no doubt lazy generalisations I/we grew up with)?

Helpful things to say and do?

Unhelpful things to not say or do?

@WHearnshaw @WillJMoule @lowendleader @tayalm175 @wavellroom @TheMaverickSgt @BO3673 I have many draft threads, and I also have a fast-approaching last day in service. #coward 

TBH I think a lot of it comes from before RMAS.

TBF I'm full of shit.

@katherinealee @zizi_87 This is one of the things I'm interested in.

I'm not trying to become a pilot (was my childhood dream though :-), but I have CVD and am interested in how different 'safety-critical' industries approach it.

Gen not a dig, but I don't think society 'gets' CVD.  Hence 'totally'.

@WillJMoule Could we collaborate?  I'm starting a coffee* company for people who intend to do a CrossFit** WOD but always end up watching Netflix in their pants instead.

*must taste shit.
*must be CrossFit.

@DDOJulesB @ARMCEN_A_COMD @WessexYeomanry @Strava @Ant_Sharman @SEAC_Defence @ArmySgtMajor @RAC_Corps_SM Initial reaction: her injury is grim!

Then: her response... fair one!

I'm doing okay thanks.  Suddenly much busier than anticipated, but doing stuff which should be of some use to society.

@NYorksPolice Simply awful.  So glad he's now in prison.

Struggling to see the relevance of 'previously being a good soldier who played rugby for the army'.

And if he insinuated PTSD as an attempt at mitigation, then I have no adequate words.

@TheImber @JimBobsterino @PtePollyanna @Fromtheranks https://t.co/0CbMirXSqD

This links in with my point about blanket treatment of these things.  Leadership isn't 'first names OR rank and surname'.  Part of leadership should be knowing which is appropriate, when.

Hey, maybe we even overthink it...

@TrevorCoultMC @Turn1t0ff https://t.co/HH1pbYuNie

@TrevorCoultMC, what happened to this?

A lot of people who can't afford to feed their children at the moment are much like many struggling veterans: good people, trying to do the right thing, in a bad situation, through little to no fault of their own.

